import logo from './logo.svg';
import './App.css';
import Content from './Components/Content';
//import {BrowserRouter ,Switch, Route, Router} from 'react-router-dom';
import { Routes ,Route } from 'react-router-dom';
const App =() =>{
  return (
   <>
      <Routes>
      <Route path="/" element={<Content/>}/>
      </Routes>
  </>

  );
}

export default App;
